import React, { useState, useEffect } from 'react';
import { Box, List, ListItem, ListItemIcon, ListItemText, Collapse, Toolbar, Divider, Typography, Avatar } from '@mui/material';
import { ExpandLess, ExpandMore, Settings, People, Security, SwapHoriz, AccountCircle } from '@mui/icons-material';
import { Link } from 'react-router-dom';
import DashboardIcon from '@mui/icons-material/Dashboard';
import axios from 'axios';
import Cookies from 'js-cookie';
import config from '../config';

const Sidebar = () => {
  const [openMantenimiento, setOpenMantenimiento] = useState(false);
  const [openProyecto, setOpenProyecto] = useState(false);
  const [userInfo, setUserInfo] = useState(null);
  const [role, setRole] = useState(null);

  useEffect(() => {
    const fetchUserInfo = async () => {
      try {
        const response = await axios.get(`${config.API_URL}/usuario/informacion`, {
          withCredentials: true,
        });
        setUserInfo(response.data.data);
        setRole(response.data.data.role);
      } catch (error) {
        console.error('Error fetching user information:', error);
      }
    };
    fetchUserInfo();
  }, []);

  const handleToggleMantenimiento = () => {
    setOpenMantenimiento(!openMantenimiento);
  };

  const handleToggleProyecto = () => {
    setOpenProyecto(!openProyecto);
  };

  return (
    <Box sx={{ width: 240, flexShrink: 0, bgcolor: 'background.paper' }}>
      <Toolbar />
      {userInfo && (
        <Box sx={{ p: 2, display: 'flex', flexDirection: 'column', alignItems: 'center', bgcolor: 'primary.main', color: 'white', borderRadius: 1, mb: 2 }}>
          <Avatar sx={{ bgcolor: 'secondary.main', width: 56, height: 56 }}>
            <AccountCircle />
          </Avatar>
          <Typography variant="h6" sx={{ mt: 1 }}>
            {userInfo.name}
          </Typography>
          <Typography variant="body2" sx={{ mb: 1 }}>
            {userInfo.email}
          </Typography>
          <Typography variant="subtitle2" sx={{ fontWeight: 'bold' }}>
            {userInfo.role}
          </Typography>
        </Box>
      )}
      <Divider />
      <List>
        <ListItem button component={Link} to="/dashboard">
          <ListItemIcon>
            <DashboardIcon />
          </ListItemIcon>
          <ListItemText primary="Dashboard" />
        </ListItem>
        {role === 'admin' && (
          <>
            <ListItem button onClick={handleToggleMantenimiento}>
              <ListItemIcon>
                <Settings />
              </ListItemIcon>
              <ListItemText primary="Mantenimiento" />
              {openMantenimiento ? <ExpandLess /> : <ExpandMore />}
            </ListItem>
            <Collapse in={openMantenimiento} timeout="auto" unmountOnExit>
              <List component="div" disablePadding>
                <ListItem button component={Link} to="/user-management" sx={{ pl: 4 }}>
                  <ListItemText primary="Gestión de Usuarios" />
                </ListItem>
                <ListItem button component={Link} to="/methodology-management" sx={{ pl: 4 }}>
                  <ListItemText primary="Gestión de Metodologías" />
                </ListItem>
              </List>
            </Collapse>
          </>
        )}
        <ListItem button onClick={handleToggleProyecto}>
          <ListItemIcon>
            <People />
          </ListItemIcon>
          <ListItemText primary="Proyecto" />
          {openProyecto ? <ExpandLess /> : <ExpandMore />}
        </ListItem>
        <Collapse in={openProyecto} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <ListItem button component={Link} to="/element-management" sx={{ pl: 4 }}>
              <ListItemText primary="Gestión de Elementos" />
            </ListItem>
            <ListItem button component={Link} to="/project-management" sx={{ pl: 4 }}>
              <ListItemText primary="Gestión de Proyectos" />
            </ListItem>
          </List>
        </Collapse>
        <ListItem button component={Link} to="/security">
          <ListItemIcon>
            <Security />
          </ListItemIcon>
          <ListItemText primary="Seguridad" />
        </ListItem>
        <ListItem button component={Link} to="/change-control">
          <ListItemIcon>
            <SwapHoriz />
          </ListItemIcon>
          <ListItemText primary="Control de Cambios" />
        </ListItem>
      </List>
    </Box>
  );
};

export default Sidebar;
